import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Prueba() {
  const [bajones, setBajones] = useState("");
  useEffect(() => {
    axios
      .get("/prueba")
      .then((res) => res.data)

      .then((data) => {
        console.log(data);
        setBajones(data);
      });
  });
  console.log("linea16", bajones);

  return (
    <div>
      <h1>
        {bajones.map((bajon) => (
          <div>
            <h1>{console.log("....", bajon)}</h1>
            <h1>{console.log("-----", bajon.name)}</h1>
          </div>
        ))}
      </h1>
    </div>
  );
}
